import React from 'react';
import {Container, Button, Row} from 'react-bootstrap';

const Floor = ({floor, className}) =>
    <Button className={className} block>Planta {floor}</Button>


const Floors = ({floors}) => <Container className="p-3">{
    floors.map((floor,i,a) => i % 2 === 0 && (
        a[i+1] != undefined ? 
            <Row className="col-12">
                <Floor className="col-5 m-1" floor={floor}/>
                <Floor className="col-6" floor={a[i+1]}/>
            </Row> 
            : 
            <Row className="col-12">
                <Floor className="col-12" floor={floor}/>
            </Row>
        )
    )
}</Container>

export default Floors;
